import React, { useState } from "react";

function Cards() {


  return (
    <div className="images_box">
        <div className="image1">
            <img src="/images/Vlad.jpg"/>
        </div>
        <div className="image2">
            <img src="/images/Vlad.jpg"/>
        </div>
        <div className="image3">
            <img src="/images/Vlad.jpg"/>         
        </div>
        <div className="image4">
            <img src="/images/Vlad.jpg"/>
        </div>
    </div>
  );
}

export default Cards
